Helsinki

Travel Documentary hosted by Heidi Hollinger, published by Discovery Channel broadcasted as part of DC Waterfront Cities of the World series in 2011 - English narration


Information
------------------------------

Helsinki is a city unlike any other: a leader in social policy, an innovator in telecommunications, nearly obsessive in its pursuit of civil organization... and the sauna capital of the world. 150 islands constitute this northern port city, whose air and water are among the purest in Europe. The city center is rife with green space. If that isnÃ‚â€™t enough, its free healthcare and education systems are considered the best in the world.

